import * as React from 'react';
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import ShiftsDataGrid from "./ShiftsDataGrid";
import { styled } from "@mui/material/styles";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Dialog from '@mui/material/Dialog';
import DialogContent from "@mui/material/Dialog";
import DialogTitle from "@mui/material/Dialog";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));


export default function ShiftsListingPage() {
 const [open, setOpen] = React.useState(false);

 const handleClickOpen = () => {
   setOpen(true);
 };

const handleClose = () => {
     setOpen(false);
};

  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
        <Grid container direction="column">
          <Grid>
            <Item>
              <Button variant="outlined" click={handleClickOpen}>
                Set Shift Assignment
              </Button>
            </Item>
            <Item>
              <ShiftsDataGrid></ShiftsDataGrid>
            </Item>
          </Grid>
        </Grid>
      </Box>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Subscribe</DialogTitle>
        <DialogContent>
          <DialogContentText>
            To subscribe to this website, please enter your email address here.
            We will send updates occasionally.
          </DialogContentText>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Email Address"
            type="email"
            fullWidth
            variant="standard"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleClose}>Subscribe</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
